var parkCars = [];
var car_color = [];
var parkStatus = [];
var i;
var jsondata = msg.payload;

for(i=0;i<6;i++)
{   
    //parkStatus.push(eval("jsondata.C" + String(i + 1)));
    parkStatus.push(jsondata);
    if (parkStatus[i] == 1 && jsondata != 3)
    {
        car_color[i] = "#df7370";
    }
    else if (parkStatus[i] == 0 && jsondata != 3)
        car_color[i] = "#70df98"

    else 
        car_color[i] = "#ced8d0";

    jsondata=2;
    parkCars[i] = {
        "command": "set_style",
        "selector": "#" + "Park_"+String(i+1),
        "attributeName": "fill",
        "attributeValue": car_color[i]
    };

}
return [{ payload: parkCars[0] }, { payload: parkCars[1] }, { payload: parkCars[2] }, { payload: parkCars[3] }, { payload: parkCars[4] }, { payload: parkCars[5] }];

